(34, 'aafdb87e68b', 'America launches Airstrikes on Syria after Chemical Attack', '<span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">Trump orders launch of 50 Tomahawk missiles on Syrian airbase. Donald Trump ordered the launch of 50 Tomahawk missiles on a Syrian airbase after the gas attack that killed many Syrian citizens.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">''No child of God should ever suffer such horror'': US military fires 59 Tomahawk cruise missiles on Trump''s orders at Homs airfield where Syrian dictator Assad launched chemical attack The US military fired more than 50 tomahawk missiles at al-Shayrat military airfield at 8.45pm EDT Thursday Moves comes just hours after Trump said ''something should happen'' following gas-attack atrocity Trump had been weighing up the possibility of launching military strikes after more than 80 were killed and countless more were injured in the sarin poison gas attack ''Even beautiful babies were cruelly murdered in this very barbaric attack,'' he said after launching the strike in an announcement from Mar-a-Lago where he''s hosting China''s President, ''It was a slow and brutal death'' Pentagon confirmed the military airfield was being used to store chemical weapons and was the base for the aircraft involved in the chemical attack on Tuesday At least four were killed, and many more were injured, in the strike which has severely damaged or destroyed the aircraft and support infrastructure Secretary of State Rex Tillerson said the US did not seek approval from Russia for the air strikes saying Moscow had been ''complicit or incompetent'' in failing to stop chemical attacks in Syria Russia has fired back warning that the strike was ''an act of aggression against a UN member''</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">President Donald Trump launched a deadly US airstrike against a Syrian air base after a horrific nerve gas attack which killed more than 80 of his own citizens.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">The US military fired 59 tomahawk missiles at the Bashar al-Assad controlled al-Shayrat military airfield near Homs at 8.45pm (EDT) on Thursday, killing at least four and injuring many more. Officials confirm that no fixed wing aircraft were involved.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">President Trump, speaking from his Mar-a-Lago estate where he is hosting the Chinese President Xi Jinping and his wife Peng as part of a two day summit, said the US had to act after the Syrian dictator launched the ''horrible chemical weapons attack'' on innocent civilians.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">''Even beautiful babies were cruelly murdered in this very barbaric attack,'' he said. ''It was a slow and brutal death for so many.''</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">The move comes just hours after Trump denounced this week''s horrific chemical weapons attack as an ''egregious crime'', saying ''it shouldn''t have happened. And it shouldn''t be allowed to happen.''</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">President Donald Trump has launched a US airstrike against a Syrian air base after the gas atrocity which killed more than 80 people</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">Pentagon officials said that the airfield was being used to store chemical weapons and was a base for Syrian air forces - including the aircraft that conducted the chemical weapons attack. Early reports indicate the strike has severely damaged or destroyed the aircraft and support infrastructure, while at least four people were killed.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">The Pentagon has released dramatic footage of one of its missile launches from USS Ross, an Arleigh Burke-class destroyer, targeting the Syrian base.</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">A Pentagon official told DailyMail.com that the president ''is dead-set against letting Assad labor under the illusion that the Syrian army can murder innocent people with impunity.''</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">''We''ve laid down a marker. No more chemical weapons attacks, period. There will be consequences. Our president is showing his American conscience, and if anyone provokes him they will regret it.''</span><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><br style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;"><span style="color: rgb(51, 51, 51); font-family: &quot;Noto Naskh Arabic UI&quot;, Roboto, arial, sans-serif; font-size: 13px; text-align: start;">The official said the Trump administration hopes Assad ''will change his ways.''</span><div>https://www.youtube.com/watch?v=Nq3qyX0TS1A</div>', 'uploads/videos/thumbnails/aafdb87e68b.jpg', 'uploads/videos/aafdb87e68b.mp4', 'mp4', 'video', '1', '146', 'adjoines', '2017-04-08 13:26:46', '2017-05-05 02:34:05'),
