(46, 'd8383cff96c', '10 Most Dangerous Gangs In The World', '<span style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;">When it comes to gangs, everyone knows that they are quite dangerous. There are often intense initiations when it comes to wanting to join these gangs that usually involve beatings, sex, and drugs. Many of these gangs make their income from illegal activities such as drug dealing, prostitution, and drug trafficking, murdering people, and stealing. Some of the most notorious and dangerous gangs have hundreds of thousands of members, and are lurking around every corner of the United States. Plus, some have even gone international (that alone should disturb you). Gangs have also provided inspiration for numerous movies, television shows, and music.</span><br style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;"><span style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;">Many gangs recruit their members while they are very young, even at elementary school age. There is a lot of speculation as to why someone would want to join a gang. Perhaps they came from a rough home life, or they don’t have a family, and they’re looking for some sort of acceptance. Or they are rebelling against their parents. It is hard to determine one good reason for anyone to join a gang. Sure, it may seem great at first. But the first time you break a rule or mess up, it could mean that you’re in for a beating that may leave permanent scares, or worse, you could be killed. Thousands of people have come out with their stories of their struggle of breaking out of the gang life, and it’s much harder than putting in your two weeks’ notice at work. Many times, these people have to move and even assume new identities to avoid any backlash from their former lives.</span><br style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;"><span style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;">Some of the most dangerous gangs in history have included the Crips and the Bloods, two rival gangs that were formed in the mid twentieth century and are considered to be ruthless in their dealings. These two gangs primarily make their money from illegal activities, usually drugs. What is even more disturbing is that the Crips has over 30,000 members. Many people are familiar with the Hells Angels, who ride their motorcycles across the country wreaking havoc on innocent lives. Hells Angels operate worldwide and are heavily involved in the prostitution scene. Other gangs include the Latin Kings, which is the largest and the largest Hispanic street gang. Vagos has over 4,000 members in Canada, Australia, and the United States. The 18th Street Gang started in Los Angeles in the 1960’s and recruit young children. The MS-13 is worldwide and focuses on Central Americans and involved in human trafficking, Cosa Nostra founded in Italy in the 1800’s and have 250,000 members worldwide, and finally Yakuza is a transnational gang formed in Japan. Ironically, Yakuza looks down on dealing drugs, but human trafficking is an acceptable practice of money making. Many gangs were formed in prison, such as the Aryan Brotherhood, which is a Neo Nazi prison gang responsible for a high about of deaths in the prison system. They are identifiable from their shaved heads and numerous tattoos that are reminiscent of Nazi Germany.</span><br style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;"><span style="color: rgb(51, 51, 51); font-family: &quot;YouTube Noto&quot;, Roboto, arial, sans-serif; font-size: 13px;">In closing, wherever you go, and whatever you do, tread carefully if you ever find yourself on a gang’s turf.</span><div><font color="#333333" face="YouTube Noto, Roboto, arial, sans-serif"><span style="font-size: 13px;"><a href="https://www.youtube.com/watch?v=0yumFLEF2Nk" title="https://www.youtube.com/watch?v=0yumFLEF2Nk" target="">https://www.youtube.com/watch?v=0yumFLEF2Nk</a></span></font><br></div>', 'uploads/videos/thumbnails/d8383cff96c.jpg', 'uploads/videos/d8383cff96c.mp4', 'mp4', 'video', '1', '143', 'adjoines', '2017-04-12 18:14:55', '2017-05-05 10:10:32'),
